import {Link} from 'react-router-dom'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useEffect,useState } from "react"
import Cookie from 'js-cookie'
import Popup from '../../components/Popup/Popup';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Popover from 'react-bootstrap/Popover';
const handleLogOut=()=>{
  const response =  fetch ('/login/logout')
  console.log(response.json)
  window.location.href="/"

}
var isCountryChosen=false



function Navbar1() {
  const [isGuest,setIsGuest] = useState(null)
  const [userId,setUserId]=useState(null)
  const [isOpen, setIsOpen] = useState(false);
  
  const [search,setSearch] = useState('');

  const togglePopup = () => {
    setIsOpen(!isOpen);
  }


  const fetchID = async () => {
    const response = await fetch('/login/userId')
    const json = await response.json()

    //console.log(json.id)

    if (response.ok) {
        setUserId(json.id)
    }
}
 
    useEffect(()=>{
       
      
        let role=Cookie.get('role')
        console.log(role)
            if (role === undefined)
                {
                  setIsGuest(true)
                }
              
              else{
                setIsGuest(false)
                fetchID()
              }


       
       },[])
       const [errorMessage, setErrorMessage] = useState('');



      const handleChange = (e) => {
        e.preventDefault();
        setSearch(e.target.value);
      };


      const goToCoursesGuest = async (e)=>{
        window.location.href='/courses/search/guest?search='+search;      
      }
    
  return (
    <div>
     
<div>
    <Navbar className="nav"  expand="lg"  >
      <Container fluid             style={{ maxHeight: '120px'}} >

       
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">

      
         
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >

   <Nav.Link  href={"/guest/courses"} style={{   color:'#006DA3',fontSize:'24px',marginLeft:"10px",
    fontFamily: 'Montserrat'}}> Products</Nav.Link>
  <Nav.Link  href={""} style={{   color:'#006DA3',fontSize:'24px',marginLeft:"10px",
    fontFamily: 'Montserrat'}}> About</Nav.Link>
  <Nav.Link  href={""} style={{   color:'#006DA3',fontSize:'24px',marginLeft:"10px",
    fontFamily: 'Montserrat'}}> FAQ</Nav.Link>
  <Nav.Link  href={""} style={{   color:'#006DA3',fontSize:'24px',marginLeft:"10px",
    fontFamily: 'Montserrat'}}> Blog</Nav.Link>
  <Nav.Link  href={""} style={{   color:'#006DA3',fontSize:'24px',marginLeft:"10px",
    fontFamily: 'Montserrat'}}> Contact</Nav.Link>
  <Navbar.Brand href="/"><img width="50%" src="/swan cosmeticspng.png"/>  </Navbar.Brand>


  <Nav.Link
  href="/Signup"
  style={{
    color: "white",
    fontFamily: 'Montserrat',
    backgroundColor: '#006DA3',
    fontSize: '18px',
    width: "224px", // Set the width
    height: "82px", // Set the height
    top: "130px", // Set the top position
    left: "1278px", // Set the left position
    padding: "0px 17px 0px 48px", // Adjust the padding as needed
    borderRadius: "40px", // Set the border radius
    gap: "23px", // Set the gap (if this is meant for flexbox, it should be used in a container)
    display: "flex", // Use flex display to apply gap
    alignItems: "center", // Center the text vertically
    justifyContent: "center" // Center the text horizontally
  }}
>
  Shop Now
</Nav.Link>
      
        
      {!isGuest && <img height="40px" style={{  marginRight:"-15px",marginLeft:"10px"  }} src="data:image/png;base64,"></img>}
         
{!isGuest  &&  

<Nav.Link onClick={handleLogOut} style={{ color:'#647cd6', fontSize:'18px', marginLeft:"5px",marginTop:"4px"}}>
                Logout   <img style={{ marginLeft:"10px" }} src="data:image/png;base64,"></img>
                </Nav.Link>}


          
           </Nav>
         
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </div>
   
</div>

    
   
    
  );
}

export default Navbar1;
